import React, { useEffect, useState } from 'react';
const weatherAPI = {
  key: "8bd04b4c4bc8f493a35b227dba34ae78",
  baseURL: "http://api.weatherapi.com/v1",
  lat: 10,
  lon: 10
}

function App() {

  const [location, setLocation] = useState({
    lat: 0,
    lon: 0
  })

  navigator.geolocation.getCurrentPosition((position)=> {
    const p=position.coords;
    console.log(p.latitude,p.longitude);
    setLocation({
      lat: p.latitude,
      lon: p.longitude
    })
  })

  function getWeatherData(){
    fetch(`https://api.openweathermap.org/data/2.5/forecast?lat=${location.lat}&lon=${location.lon}&appid=8bd04b4c4bc8f493a35b227dba34ae78`)
      .then(response => response.json())
      .then(data => console.log(data));
  }

  return (
    <div>
      <h1>Weather app</h1>
    </div>
  );
}

export default App;
